INSERT INTO `listings` VALUES (1,3,93,'Padila','Doggy Street, Brasilia, Bresil','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host13.jpg','whale-built nest in cowtown','From the outside this house looks nice and traditional. It has been built with tan stones and has tan stone decorations. Small, half rounded windows add to the overall style of the house and have been added to the house in a very symmetric way.','Set on the peak of a wetlands, the township of Gloufry is home to gnomes lead by Director Bimbik. This township wasnt built by a wetlands by accident, as it has ancient burial grounds, which is of great importance to the people of Gloufry and its success.'),(2,1,96,'Kookaburra','Bone Street, Peking, China','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host2.jpg','open air nest in dog park','The building is shaped like an L. The extension extends into wooden sunscreens structures circling around half the house.The second floor is the same size as the first, but part of it hangs over the edge of the floor below, creating an overhang on one side and a balcony on the other. This floor has a very different style than the floor below.','Pernrith has a flourishing economy, which is mainly supported by tailoring, armorsmithing and thieving. But their biggest strengths are highly skilled thieving and weaponsmithing. However, Pernrith lacks people skilled in crafting.'),(3,3,116,'Neon','Woof Street, Miami, United States','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host0.jpg','spacious lions den by upscale guppie area','The roof is low, triangular, but one side is longer than the other and is covered with brown roof tiles. Two small chimneys poke out the center of the roof. Rows of small windows let in plenty of light to the rooms below the roof.The house itself is surrounded by paved ground, with an outdoor eating and relaxing space and various potted plants.','Despite its strengths and weaknesses, Pernrith is most likely headed towards a affluent future under the leadership of Commander Masser. But this remains to be seen.'),(4,3,61,'Neon','Woof Street, Miami, United States','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host0.jpg','gllamarous lions den by upscale guppie area','The roof is low, triangular, but one side is longer than the other and is covered with brown roof tiles. Two small chimneys poke out the center of the roof. Rows of small windows let in plenty of light to the rooms below the roof.The house itself is surrounded by paved ground, with an outdoor eating and relaxing space and various potted plants.','Despite its strengths and weaknesses, Pernrith is most likely headed towards a affluent future under the leadership of Commander Masser. But this remains to be seen.'),(5,3,119,'Flurry','Doggy Street, Kingston, Jamaica','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host5.jpg','open air barn by dog park','From the outside this house looks impressive. It has been built with bricks covered in render and has red pine wooden decorations. Small, rectangular windows add to the overall style of the house and have been added to the house in a fairly symmetrical pattern.','Gloufry has a mending economy, which is mainly supported by leatherworking, farming and herbalism. But their biggest strengths are refined baking and alchemy. However, Gloufry lacks people skilled in war.'),(6,1,108,'Guaymas','Animal Town, Dakhar, Senegal','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host9.jpg','spacious fishbowl close to dog park','The building is shaped like a short U. The two extensions are linked by wooden sunscreens structures.The second floor is bigger than the first, which creates several overhanging parts on several sides of the house. This floor has a slightly different style than the floor below.','Despite its strengths and weaknesses, Cullfield is most likely headed towards a harsh future under the leadership of Lady Gedney. But this remains to be seen.'),(7,1,11,'Ollie','Kitty Street, Lagos, Nigeria','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host6.jpg','brand new lions den close to dog park','From the outside this house looks old, but wonderful. It has been built with brown bricks and has red brick decorations. Tall, squared windows allow enough light to enter the home and have been added to the house in a fairly asymmetrical pattern.','Cast on the lowest point of a forest, the outpost of Pernrith is home to humans lead by Commander Masser. This outpost wasnt built by a forest by accident, as it has hidden tunnels, which is of great importance to the people of Pernrith and its success.'),(8,2,18,'Omega','Miaw Street, Port-au-Prince, Haiti','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host1.jpg','cozy doghouse by cowtown','The house is equipped with an old-fashioned kitchen and one small bathroom, it also has a warm living room, four bedrooms, a cozy dining room and a cozy storage room.','The outpost itself looks luxuriant. With its yew wood rooftops, elm wood walls and white, sandy beaches, Pernrith has a intriguing atmosphere. The main attraction is the farm, which was built 54 years ago and designed by fairies.'),(9,1,81,'Kookaburra','Bone Street, Peking, China','https://s3-us-west-1.amazonaws.com/hackreactor-fec-hero/listings/host2.jpg','gllamarous nest by dog park','From the outside this house looks impressive. It has been built with bricks covered in render and has red pine wooden decorations. Small, rectangular windows add to the overall style of the house and have been added to the house in a fairly symmetrical pattern.','Gloufry has a mending economy, which is mainly supported by leatherworking, farming and herbalism. But their biggest strengths are refined baking and alchemy. However, Gloufry lacks people skilled in war.'),(10,3,80,'Bonza','Kitten Street, Mexico City, Mexico','https://s3-us-west-1.amazonaws.com/h